import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Navbar from "./components/Main/Navbar";
import About from "./components/Main/About";
import Footer from "./components/Main/Footer";
import Contact from "./components/Main/Contact";
import Experience from "./components/Main/Experience";
import Carousel from "./components/Main/Carousel";
import Technologies from "./components/Main/Technologies";
import WauMatch from "./components/WauMatch/WauMatch";
import TFGPoke from "./components/TFGPoke/TFGPoke";

function App() {
  return (
    <Router>
      <div className="bg-black text-white min-h-screen pb-12 w-full">
        <Routes>
          {/* Página principal con todos los componentes */}
          <Route
            path="/"
            element={
              <>
                <Navbar />
                <About />
                <Carousel />
                <Experience />
                <Technologies />
                <Contact />
              </>
            }
          />

          {/* Página del proyecto WauMatch */}
          <Route path="/projects/waumatch" element={<WauMatch />} />

          {/* ✅ Página del proyecto TFG Pokémon */}
         <Route path="/projects/tfgpoke" element={<TFGPoke />} />
        </Routes>

        <Footer />
      </div>
    </Router>
  );
}

export default App;
